  <script>
    function showSoundPrompt() {
      const promptDiv = document.createElement('div')
      promptDiv.id = 'soundPrompt'
      promptDiv.innerHTML = `
          <div style="position:fixed;top:0;left:0;right:0;bottom:0;background:rgba(0,0,0,0.5);display:flex;align-items:center;justify-content:center;z-index:9999;">
            <button id="enableSound" style="padding:20px;font-size:24px;background:#fff;border:none;border-radius:8px;cursor:pointer;">
               Click to enable sound
            </button>
          </div>
        `;
      document.body.appendChild(promptDiv)

      document.getElementById('enableSound').addEventListener('click', function () {
        document.body.removeChild(promptDiv)
        bgm.play().catch(e => console.error('Still blocked:', e))
      });
    }
    function wait(ms) {
      return new Promise(function (resolve) {
        setTimeout(resolve, ms)
      });
    }

    document.addEventListener("DOMContentLoaded", function () {
      var bgm = document.getElementById("bgm")
      var text = document.getElementById("text")
      if (text) {
        const newText = new URLSearchParams(window.location.href.split('?')?.[1] || 'text=idklol').get('text')
        text.innerText = newText
        text.setAttribute('data-text', newText)
      }
      if (bgm) {
        wait(100).then(function () {
          bgm.play().catch(err => {
            showSoundPrompt()
          })
        })
      }
    })
  </script>
